function TodoList() {
  return (
    <ul className="list-group shadown mt-3">
      <Todo title="Homework" completed={true} />
      <Todo title="Personal project figma" completed={fasle} />
      <Todo title="Midterm exam" completed={true} />
      <Todo title="Lab" completed={true} />
    </ul>
  );
}
export default TodoList;
